(22, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', 'Thanks for registering!\n\nTo complete the activation of your account, go to the following link and click on the <strong>Activate</strong> button:\n<a href=\"{{{activate.url}}}\">{{{activate.url}}}</a>\n\nIf the \'Activation Key\' field is empty, copy and paste the following into the field - {{key}}', '[{{{site.name}}}] Activate your account', 'Thanks for registering!\n\nTo complete the activation of your account, go to the following link and click on the \'Activate\' button: {{{activate.url}}}\n\nIf the \'Activation Key\' field is empty, copy and paste the following into the field - {{key}}', 'publish', 'closed', 'closed', '', 'site-name-activate-your-account', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=22', 0, 'bp-email', '', 0),
(23, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', '<a href=\"{{{initiator.url}}}\">{{initiator.name}}</a> wants to add you as a friend.\n\nTo accept this request and manage all of your pending requests, visit: <a href=\"{{{friend-requests.url}}}\">{{{friend-requests.url}}}</a>', '[{{{site.name}}}] New friendship request from {{initiator.name}}', '{{initiator.name}} wants to add you as a friend.\n\nTo accept this request and manage all of your pending requests, visit: {{{friend-requests.url}}}\n\nTo view {{initiator.name}}\'s profile, visit: {{{initiator.url}}}', 'publish', 'closed', 'closed', '', 'site-name-new-friendship-request-from-initiator-name', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=23', 0, 'bp-email', '', 0),
(24, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', '<a href=\"{{{friendship.url}}}\">{{friend.name}}</a> accepted your friend request.', '[{{{site.name}}}] {{friend.name}} accepted your friendship request', '{{friend.name}} accepted your friend request.\n\nTo learn more about them, visit their profile: {{{friendship.url}}}', 'publish', 'closed', 'closed', '', 'site-name-friend-name-accepted-your-friendship-request', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=24', 0, 'bp-email', '', 0),
(25, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', 'Group details for the group &quot;<a href=\"{{{group.url}}}\">{{group.name}}</a>&quot; were updated:\n<blockquote>{{changed_text}}</blockquote>', '[{{{site.name}}}] Group details updated', 'Group details for the group \"{{group.name}}\" were updated:\n\n{{changed_text}}\n\nTo view the group, visit: {{{group.url}}}', 'publish', 'closed', 'closed', '', 'site-name-group-details-updated', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=25', 0, 'bp-email', '', 0),
(26, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', '<a href=\"{{{inviter.url}}}\">{{inviter.name}}</a> has invited you to join the group: &quot;{{group.name}}&quot;.\n{{invite.message}}\n<a href=\"{{{invites.url}}}\">Go here to accept your invitation</a> or <a href=\"{{{group.url}}}\">visit the group</a> to learn more.', '[{{{site.name}}}] You have an invitation to the group: \"{{group.name}}\"', '{{inviter.name}} has invited you to join the group: \"{{group.name}}\".\n\nTo accept your invitation, visit: {{{invites.url}}}\n\nTo learn more about the group, visit: {{{group.url}}}.\nTo view {{inviter.name}}\'s profile, visit: {{{inviter.url}}}', 'publish', 'closed', 'closed', '', 'site-name-you-have-an-invitation-to-the-group-group-name', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=26', 0, 'bp-email', '', 0),
(27, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', 'You have been promoted to <b>{{promoted_to}}</b> in the group &quot;<a href=\"{{{group.url}}}\">{{group.name}}</a>&quot;.', '[{{{site.name}}}] You have been promoted in the group: \"{{group.name}}\"', 'You have been promoted to {{promoted_to}} in the group: \"{{group.name}}\".\n\nTo visit the group, go to: {{{group.url}}}', 'publish', 'closed', 'closed', '', 'site-name-you-have-been-promoted-in-the-group-group-name', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=27', 0, 'bp-email', '', 0),
(28, 1, '2020-02-25 19:27:33', '2020-02-25 19:27:33', '<a href=\"{{{profile.url}}}\">{{requesting-user.name}}</a> wants to join the group &quot;{{group.name}}&quot;.\n {{request.message}}\n As you are an administrator of this group, you must either accept or reject the membership request.\n\n<a href=\"{{{group-requests.url}}}\">Go here to manage this</a> and all other pending requests.', '[{{{site.name}}}] Membership request for group: {{group.name}}', '{{requesting-user.name}} wants to join the group \"{{group.name}}\". As you are the administrator of this group, you must either accept or reject the membership request.\n\nTo manage this and all other pending requests, visit: {{{group-requests.url}}}\n\nTo view {{requesting-user.name}}\'s profile, visit: {{{profile.url}}}', 'publish', 'closed', 'closed', '', 'site-name-membership-request-for-group-group-name', '', '', '2020-02-25 19:27:33', '2020-02-25 19:27:33', '', 0, 'https://devgatsbyint.wpengine.com/?post_type=bp-email&p=28', 0, 'bp-email', '', 0),
