(79, 1, '2018-10-23 09:31:58', '2018-10-23 19:31:58', '<!-- wp:paragraph -->\n<p>Welcome to image alignment! The best way to demonstrate the ebb and flow of the various image positioning options is to nestle them snuggly among an ocean of words. Grab a paddle and let’s get started.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>On the topic of alignment, it should be noted that users can choose from the options of&nbsp;<em>None﻿</em>,&nbsp;<em>Left</em>,&nbsp;<em>Right, </em>and&nbsp;<em>Center</em>. In addition, they also get the options of&nbsp;<em>Thumbnail</em>,&nbsp;<em>Medium</em>,&nbsp;<em>Large</em>&nbsp;&amp;&nbsp;<em>Fullsize</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":80} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-580x300.jpg\" alt=\"\" class=\"wp-image-80\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The image above happens to be&nbsp;<em><strong>centered</strong></em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"left\",\"id\":81} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-150x150.jpg\" alt=\"\" class=\"wp-image-81\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The rest of this paragraph is filler&nbsp;for the sake of seeing the text wrap around the 150×150 image, which is <em><strong>left aligned</strong></em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we’ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it’s thang. Mission accomplished!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>And now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":82} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-1200x4002.jpg\" alt=\"\" class=\"wp-image-82\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"right\",\"id\":83} -->\n<div class=\"wp-block-image\"><figure class=\"alignright\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-300x200.jpg\" alt=\"\" class=\"wp-image-83\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>And now we’re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there… Hey guy! Way to rock that right side. I don’t care what the left aligned image says, you look great. Don’t let anyone else tell you differently.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In just a bit here, you should see the text start to wrap below the \nright aligned image and settle in nicely. There should still be plenty \nof room and everything should be sitting pretty.&nbsp;Yeah… Just like that. \nIt never felt so good to be right.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The following image is <em><strong>wide</strong></em> (if the theme supports it, that is). If not, who knows what will happen!<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"wide\",\"id\":82} -->\n<figure class=\"wp-block-image alignwide\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-1200x4002.jpg\" alt=\"\" class=\"wp-image-82\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>What\'s that? You wanted to see a <strong>full-width image block?</strong> Well then feast your eyes on the following.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"full\",\"id\":84} -->\n<figure class=\"wp-block-image alignfull\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/soworthloving-wallpaper.jpg\" alt=\"\" class=\"wp-image-84\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>There\'s something missing! But don\'t worry, we\'ve got the <strong><em>cover image blocks</em></strong>... covered.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg\",\"id\":85} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg)\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">This is a regular cover image.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:cover {\"url\":\"https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg\",\"id\":85} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg)\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">This is a <em>wide</em> cover image.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:cover {\"url\":\"https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg\",\"id\":85} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg)\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">This is a <em>full-width</em> cover image.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph -->\n<p>And just when you thought we were done, we’re going to do them all over again with captions!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":80} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-580x300.jpg\" alt=\"\" class=\"wp-image-80\"/><figcaption>Look at 580×300 getting some <a href=\"http://en.support.wordpress.com/images/image-settings/\">caption</a> love.</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The image above happens to be&nbsp;<em><strong>centered</strong></em>. The caption also has a link in it, just to see if it does anything funky.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"left\",\"id\":81} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-150x150.jpg\" alt=\"\" class=\"wp-image-81\"/><figcaption>Itty-bitty caption</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The rest of this paragraph is filler&nbsp;for the sake of seeing the text wrap around the 150×150 image, which is <em><strong>left aligned</strong></em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we’ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it’s thang. Mission accomplished!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>And now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":82} -->\n<figure class=\"wp-block-image\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-1200x4002.jpg\" alt=\"\" class=\"wp-image-82\"/><figcaption>Massive image comment for your eyeballs.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>The image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"align\":\"right\",\"id\":83} -->\n<div class=\"wp-block-image\"><figure class=\"alignright\"><img src=\"https://chrisrunnells.files.wordpress.com/2018/10/image-alignment-300x200.jpg\" alt=\"\" class=\"wp-image-83\"/><figcaption>Feels good to be right all the time.</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>And now we’re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there… Hey guy! Way to rock that right side. I don’t care what the left aligned image says, you look great. Don’t let anyone else tell you differently.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah… Just like that. It never felt so good to be right.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We\'re gonna take one more trip down cover image lane.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:cover {\"url\":\"https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg\",\"id\":85} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(https://chrisrunnells.files.wordpress.com/2018/10/unicorn-wallpaper.jpg)\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">The <strong>unicorn</strong> is a <a href=\"https://en.wikipedia.org/wiki/Legendary_creature\">legendary creature</a> that has been described since antiquity as a beast with a single large, pointed, spiraling horn projecting from it\'s forehead. In European folklore, the unicorn is often depicted as a white horse-like or goat-like animal with a long horn and clove hooves. <br><br>In the Middle Ages and Renaissance, it was commonly described as an extremely wild woodland creature, a symbol of purity and grace, which could be captured only by a virgin.<br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:cover {\"url\":\"https://chrisrunnells.files.wordpress.com/2018/10/manuel-will-156344-unsplash.jpg\",\"id\":86,\"hasParallax\":true} -->\n<div class=\"wp-block-cover has-background-dim has-parallax\" style=\"background-image:url(https://chrisrunnells.files.wordpress.com/2018/10/manuel-will-156344-unsplash.jpg)\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">This wide cover image background is fixed.<br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:paragraph -->\n<p>And that’s a wrap, yo! You survived the&nbsp;tumultuous&nbsp;waters of alignment. Image alignment achievement unlocked!</p>\n<!-- /wp:paragraph -->', 'Gutenberg: Image Alignment', '', 'publish', 'open', 'open', '', 'gutenberg-image-alignment', '', '', '2020-09-17 15:32:16', '2020-09-17 15:32:16', '', 0, 'https://chrisrunnells.wordpress.com/?p=79', 0, 'post', '', 0),
