(94, 1, '2018-10-23 15:33:34', '2018-10-24 01:33:34', '<!-- wp:heading {\"level\":3} -->\n<h3>Paragraph Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"dropCap\":true} -->\n<p class=\"has-drop-cap\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris purus urna, vulputate at convallis hendrerit, mattis id mi. Nulla mauris justo, sodales vitae sodales nec, fermentum at elit. Proin condimentum risus sed venenatis mollis. Donec auctor euismod sodales. Donec sodales congue metus, sit amet tempor odio maximus in. Ut vestibulum nisl a maximus scelerisque. Donec aliquam eleifend metus, eget iaculis ante vestibulum id. Nulla facilisi. Nullam interdum sagittis accumsan. Phasellus egestas elementum enim nec condimentum. Sed mattis purus odio. Curabitur vehicula rutrum porttitor. Phasellus tempus dui id turpis fermentum, auctor dictum mauris mollis.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":1} -->\n<h1>Header 1</h1>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Header 2</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Header 3</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Header 4</h4>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Header 5</h5>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":6} -->\n<h6>Header 6</h6>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Image Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":7752,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2020/08/1003-1181x1772-1-682x1024.jpg\" alt=\"\" class=\"wp-image-7752\"/><figcaption>A pretty unicorn</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:gallery {\"ids\":[97,96,95,100,101,102,103]} -->\n<figure class=\"wp-block-gallery columns-3 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/casey-horner-512022-unsplash-684x1024.jpg\" alt=\"\" data-id=\"97\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/casey-horner-512022-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/casey-horner-512022-unsplash/\" class=\"wp-image-97\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/brandon-siu-608784-unsplash-1024x684.jpg\" alt=\"\" data-id=\"96\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/brandon-siu-608784-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/brandon-siu-608784-unsplash/\" class=\"wp-image-96\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/aperture-vintage-346923-unsplash-1024x683.jpg\" alt=\"\" data-id=\"95\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/aperture-vintage-346923-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/aperture-vintage-346923-unsplash/\" class=\"wp-image-95\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/federico-bottos-442265-unsplash-627x1024.jpg\" alt=\"\" data-id=\"100\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/federico-bottos-442265-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/federico-bottos-442265-unsplash/\" class=\"wp-image-100\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/jordan-steranka-504707-unsplash-683x1024.jpg\" alt=\"\" data-id=\"101\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/jordan-steranka-504707-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/jordan-steranka-504707-unsplash/\" class=\"wp-image-101\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/kristopher-roller-110203-unsplash-1024x683.jpg\" alt=\"\" data-id=\"102\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/kristopher-roller-110203-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/kristopher-roller-110203-unsplash/\" class=\"wp-image-102\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/zoltan-tasi-482489-unsplash-1024x688.jpg\" alt=\"\" data-id=\"103\" data-full-url=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/zoltan-tasi-482489-unsplash-scaled.jpg\" data-link=\"https://devgatsbyint.wpengine.com/2018/10/23/gutenberg-common-blocks/zoltan-tasi-482489-unsplash/\" class=\"wp-image-103\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>List Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>List Item One</li><li>List Item Two</li><li>List Item Three</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>List Item One</li><li>List Item Two</li><li>List Item Three</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Quote Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>This is a quote block. It\'s aligned to the side at least in the default styles. Pretty darn amazing.</p><cite>Laurel Fulford</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Large Quote Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:quote {\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote is-style-large\"><p>Use the force, Luke.</p><cite>Obi-Wan Kenobi</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Audio Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:audio {\"id\":10621} -->\n<figure class=\"wp-block-audio\"><audio controls src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2020/10/mattmullenweg-interview.mp3\"></audio><figcaption>Tom Raftery interviews Matt Mullenweg and Donncha Ó Caoimh</figcaption></figure>\n<!-- /wp:audio -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Cover Image Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:cover {\"url\":\"https://devgatsbyint.wpengine.com/wp-content/uploads/2020/10/Screen-Shot-2020-07-30-at-1.34.09-PM.png\",\"id\":10715,\"focalPoint\":{\"x\":\"0.04\",\"y\":\"0.50\"}} -->\n<div class=\"wp-block-cover has-background-dim\" style=\"background-image:url(https://devgatsbyint.wpengine.com/wp-content/uploads/2020/10/Screen-Shot-2020-07-30-at-1.34.09-PM.png);background-position:4% 50%\"><div class=\"wp-block-cover__inner-container\"><!-- wp:paragraph {\"align\":\"center\",\"placeholder\":\"Write title…\",\"fontSize\":\"large\"} -->\n<p class=\"has-text-align-center has-large-font-size\">This is a cover image block.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:cover -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>File Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:html -->\n<div class=\"wp-block-file\"><a href=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\">WordPress-logotype-standard</a><a href=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2018/10/wordpress-logotype-standard.pdf\" class=\"wp-block-file__button\">Download</a></div>\n<!-- /wp:html -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Video Block</h3>\n<!-- /wp:heading -->\n\n<!-- wp:video {\"id\":10627} -->\n<figure class=\"wp-block-video\"><video autoplay controls loop src=\"https://devgatsbyint.wpengine.com/wp-content/uploads/2020/10/giphy.mp4\"></video><figcaption>Now that\'s a fun animation!</figcaption></figure>\n<!-- /wp:video -->', 'Gutenberg: Common Blocks', '', 'publish', 'open', 'open', '', 'gutenberg-common-blocks', '', '', '2020-10-07 03:05:49', '2020-10-07 03:05:49', '', 0, 'https://chrisrunnells.wordpress.com/?p=94', 0, 'post', '', 0),
